function funcSearch() {
  log("funcSearch");
  const els = document.getElementsByClassName("cm_confirm_list_list")[0].getElementsByTagName("tr");
  const result = [];
  const dictCourse = {
    1: "마운틴",
    2: "오아시스",
    3: "와일드",
  };
  Array.from(els).forEach((el, i) => {
    if(i == 0) return;
    if(el.children.length < 5) return;
    const param = el.children[5].children[0].getAttribute("href").inparen();
    const date = param[2];
    const time = param[3];
    const course = param[4];
    console.log("reserve search", dictCourse[course], date, time);
    result.push({ date, time, course: dictCourse[course] });
  });
  const param = {
    golf_club_id: "1b01f7dc-ee3b-11ec-a93e-0242ac11000a",
    device_id: "${deviceId}",
    result,
  };
  const addr = OUTER_ADDR_HEADER + "/api/reservation/newReserveSearch";
  post(addr, param, { "Content-Type": "application/json" }, (data) => {
    console.log(data);
    funcEnd();
  });
}
